import styles from './Home.module.scss';
import React from 'react';
import Layout from 'Layout.js';
// import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <Layout>
      <div className={styles.wrapper}>
        <div className={styles.container}>
          <h1>Ana Paduraru</h1>
        </div>
      </div>
    </Layout>

  );
}
export default Home;
